import React from 'react'
import './TableHeader.css'

function TableHeader() {

  return (
    <thead>
        <tr>
            <th>Product</th>
            <th>Price</th>
            <th>Quantity</th>
            <th>Cost</th>
            <th></th>
        </tr>
    </thead>
    )
}

export default TableHeader;
